import { Flex, Typography } from "antd";
import { primaryColor } from "../config";

const { Title, Text } = Typography;

export const CardContact = ({sty}) => (
  <Flex vertical style={{ justifyContent: 'center', alignItems: 'center', textAlign: 'center' }}>
    <Title level={3} style={{ color: primaryColor }}>Contact Us</Title>
    <Text style={{ ...sty.components.Text }}>Have questions? We're here to help!</Text>
  </Flex>
)
